/** @format */

import React from "react";
import { Link } from "react-router-dom";

const ImageCardList = (character) => {
  console.log(character);
  return (
    <div>
      <img src={character.image} />
      <h2>{character.name}</h2>
    </div>
  );
};
export default ImageCardList;
